import React from 'react';
import s from './Profile.module.css';

const Profile = () => {
    return (
      <div className={s.content}>
        <div className={s.cover}>
          <img src="https://i.pinimg.com/originals/30/81/a9/3081a9e652f79a03504d0b3ebfd55b12.jpg" />
        </div>
        <div>Avatar + info </div>
        <div>
          My post
          <div>New post</div>
          <div>
            <div>post 1</div>
            <div>post 2</div>
          </div>
        </div>
      </div>
    );
}
export default Profile;
